content.css:
.visual-host {
  margin: 0;
  padding: 0;
  width: 100%;
  height: 100%;
  overflow: hidden;
}
.poem-text {
  display: flex;
  align-items: center;
  width: 100%;
  height: 100%;
  padding: 20px;
  box-sizing: border-box;
  white-space: pre-wrap;
  word-wrap: break-word;
  line-height: 1.5;
  transition: all 0.2s ease-in-out;
}
